INSERT INTO `tbl_posts` VALUES (7,'<div class=\"desc__item\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"mb-5 mb-lg-0\">\r\n<div class=\"desc__item--content\">\r\n<h3 class=\"desc__item--title\" style=\"text-align: center;\">Hội nghị khoa học thường ni&ecirc;n Ho&agrave;n Mỹ</h3>\r\nH&agrave;ng năm, Ho&agrave;n Mỹ tổ chức &ldquo;Hội nghị Khoa học Kỹ thuật Ho&agrave;n Mỹ&rdquo; để c&aacute;c đơn vị v&agrave; c&aacute; nh&acirc;n cả trong v&agrave; ngo&agrave;i hệ thống Ho&agrave;n Mỹ c&oacute; cơ hội tr&igrave;nh b&agrave;y về c&aacute;c đề t&agrave;i nghi&ecirc;n cứu mới mang t&iacute;nh thực tiễn cao. Những b&aacute;o c&aacute;o của Ho&agrave;n Mỹ đều l&agrave; những đề t&agrave;i nghi&ecirc;n cứu xuất sắc được Văn ph&ograve;ng Y khoa của Tập đo&agrave;n đ&aacute;nh gi&aacute; v&agrave; tuyển chọn một c&aacute;ch kh&aacute;ch quan, cẩn trong. Hội nghị cũng l&agrave; dịp để đội ngũ chuy&ecirc;n m&ocirc;n Ho&agrave;n Mỹ chia sẻ v&agrave; học hỏi c&aacute;c kiến thức, kinh nghiệm, kỹ thuật y khoa ti&ecirc;n tiến v&agrave; mới nhất với c&aacute;c đồng nghiệp b&ecirc;n ngo&agrave;i hệ thống Ho&agrave;n Mỹ, qua đ&oacute; gi&uacute;p n&acirc;ng cao chất lượng kh&aacute;m chữa bệnh v&agrave; thực h&agrave;nh l&acirc;m s&agrave;ng tr&ecirc;n quy m&ocirc; to&agrave;n hệ thống Ho&agrave;n Mỹ.</div>\r\n<div class=\"desc__item--content\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"mb-5 mb-lg-0 h-100\">\r\n<div class=\"desc__item--img h-100\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"desc__item\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"mb-5 mb-lg-0\">\r\n<div class=\"desc__item--content\">\r\n<h3 class=\"desc__item--title\">&nbsp;</h3>\r\nKể từ khi th&agrave;nh lập, Hội nghị đ&atilde; đề cập đến c&aacute;c chủ đề trong nhiều lĩnh vực y tế, từ nội khoa đến phẫu thuật, dược, điều dưỡng, dịch vụ cận l&acirc;m s&agrave;ng, kiểm so&aacute;t nhiễm khuẩn, cải thiện quản l&yacute; chất lượng, v.v. Sự tiếp x&uacute;c n&agrave;y đ&atilde; trang bị cho đội ngũ nh&acirc;n vi&ecirc;n đ&ocirc;ng đảo của ch&uacute;ng t&ocirc;i những kiến ​​thức v&agrave; chuy&ecirc;n m&ocirc;n y tế cập nhật nhất đ&atilde; được đưa v&agrave;o ứng dụng thực tế tại c&aacute;c bệnh viện v&agrave; ph&ograve;ng kh&aacute;m của ch&uacute;ng t&ocirc;i. Dựa tr&ecirc;n mạng lưới bệnh viện v&agrave; ph&ograve;ng kh&aacute;m rộng khắp trải d&agrave;i một số tỉnh th&agrave;nh ở Việt Nam, Ho&agrave;n Mỹ c&oacute; thể sử dụng chuy&ecirc;n m&ocirc;n tổng hợp của tất cả c&aacute;c tổ chức để bắt tay v&agrave;o một loạt c&aacute;c chương tr&igrave;nh nghi&ecirc;n cứu đa dạng. Ch&uacute;ng t&ocirc;i cũng c&oacute; ch&iacute;n nh&oacute;m chuy&ecirc;n gia l&acirc;m s&agrave;ng đang hoạt động từ ch&iacute;n chuy&ecirc;n ng&agrave;nh, c&aacute;c th&agrave;nh vi&ecirc;n của họ tiến h&agrave;nh c&aacute;c hoạt động nghi&ecirc;n cứu khoa học to&agrave;n diện v&agrave; c&oacute; hệ thống. Nhiều b&agrave;i b&aacute;o nghi&ecirc;n cứu khoa học của c&aacute;c học vi&ecirc;n Ho&agrave;n Mỹ đ&atilde; được đăng tải tr&ecirc;n c&aacute;c tạp ch&iacute; y khoa trong nước, khẳng định vị thế v&agrave; năng lực nghi&ecirc;n cứu của Ho&agrave;n Mỹ trong ng&agrave;nh y tế.</div>\r\n<div class=\"desc__item--content\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\"></div>\r\n<div class=\"desc__item--content\">&nbsp;</div>\r\n<div class=\"desc__item--content\">\r\n<h3 class=\"desc__item--title\">Đổi mới dịch vụ chăm s&oacute;c: Lấy bệnh nh&acirc;n l&agrave;m trung t&acirc;m</h3>\r\nMột trong những gi&aacute; trị cốt l&otilde;i của Ho&agrave;n Mỹ l&agrave; &ldquo;tất cả v&igrave; người bệnh&rdquo;. V&igrave; vậy, Ho&agrave;n Mỹ kh&ocirc;ng ngừng nỗ lực cải tiến v&agrave; s&aacute;ng tạo để vận h&agrave;nh hiệu quả hơn v&agrave; mang lại trải nghiệm tốt hơn cho kh&aacute;ch h&agrave;ng. Ho&agrave;n Mỹ tự h&agrave;o l&agrave; tổ chức y tế ti&ecirc;n phong trong việc &aacute;p dụng phương ph&aacute;p quản l&yacute; chất lượng của ng&agrave;nh sản xuất &ldquo;lean six sigma&rdquo; v&agrave;o hoạt động cải tiến chất lượng v&agrave; n&acirc;ng cao trải nghiệm người bệnh. H&agrave;ng năm, mỗi bệnh viện trong hệ thống Ho&agrave;n Mỹ c&oacute; trung b&igrave;nh hơn 20 s&aacute;ng kiến v&agrave; dự &aacute;n cải tiến v&agrave; s&aacute;ng tạo được thực hiện. Nhiều dự &aacute;n c&oacute; mức độ th&agrave;nh c&ocirc;ng cao, gi&uacute;p tăng hiệu quả c&ocirc;ng việc v&agrave; mức độ h&agrave;i l&ograve;ng của người bệnh, đồng thời giảm l&atilde;ng ph&iacute; v&agrave; giảm sai s&oacute;t chuy&ecirc;n m&ocirc;n. Nhiều s&aacute;ng kiến được chọn lựa để b&aacute;o c&aacute;o trong c&aacute;c hội nghị quản l&yacute; chất lượng của Bộ Y tế v&agrave; c&aacute;c Sở Y tế địa phương. Nhờ c&aacute;c hoạt động s&aacute;ng tạo n&agrave;y, c&aacute;c bệnh viện Ho&agrave;n Mỹ được nhiều bệnh viện ngo&agrave;i hệ thống lựa chọn l&agrave; nơi tham quan, học hỏi v&agrave; chia sẻ kinh nghiệm chuy&ecirc;n m&ocirc;n. Nhiều s&aacute;ng kiến ​​đ&atilde; được tr&igrave;nh b&agrave;y tại c&aacute;c hội nghị quản l&yacute; chất lượng do Sở Y tế địa phương hoặc Bộ Y tế tổ chức. Ngo&agrave;i ra, c&aacute;c bệnh viện ngo&agrave;i mạng lưới Ho&agrave;n Mỹ cũng chọn Ho&agrave;n Mỹ l&agrave;m m&ocirc; h&igrave;nh học tập.</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"mb-5 mb-lg-0 h-100\">\r\n<div class=\"desc__item--img h-100\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2024-08-15 14:48:46.445000','/uploads/images/image-1-2.png','Chúng tôi ủng hộ việc áp dụng các thực hành lâm sàng tốt nhất, công nghệ mới và theo đuổi các giải pháp sáng tạo để dẫn đầu một ngành công nghiệp đang thay đổi nhanh chóng như của chúng tôi, chúng tôi không ngừng cải tiến và liên tục đổi mới hệ thống, quy trình, sản phẩm và kỹ thuật của mình',1,'Nghiên cứu & Cải tiến','2024-08-15 15:10:49.565000','nghien-cuu-cai-tien',1),(8,'<p>C&aacute;c yếu tố nguy cơ g&acirc;y ra hội chứng mạch v&agrave;nh cấp bao gồm h&uacute;t thuốc, uống rượu v&agrave; bia qu&aacute; mức, ăn uống kh&ocirc;ng l&agrave;nh mạnh, thiếu hoạt động thể chất, stress v&agrave; c&aacute;c bệnh l&yacute; kh&aacute;c như tiểu đường, tăng huyết &aacute;p, b&eacute;o ph&igrave;, v&agrave; tăng cholesterol m&aacute;u.</p>\r\n<p>Thay đổi lối sống bao gồm tăng cường hoạt động thể chất, hạn chế h&uacute;t thuốc v&agrave; uống rượu, ăn uống l&agrave;nh mạnh, kiểm tra sức khỏe định kỳ, giảm stress, gi&uacute;p giảm yếu tố nguy cơ v&agrave; cải thiện sức khỏe tim mạch. Việc thay đổi lối sống kh&ocirc;ng chỉ hỗ trợ ph&ograve;ng ngừa hội chứng mạch v&agrave;nh cấp, m&agrave; c&ograve;n c&oacute; lợi cho sức khỏe tổng thể của cơ thể, gi&uacute;p gia tăng sức đề kh&aacute;ng, giảm nguy cơ mắc c&aacute;c bệnh kh&aacute;c v&agrave; tăng tuổi thọ.</p>\r\n<p>Để ph&ograve;ng ngừa hội chứng mạch v&agrave;nh cấp, h&atilde;y tu&acirc;n thủ một số lời khuy&ecirc;n dưới đ&acirc;y:</p>\r\n<h2>1.Vận động thể chất thường xuy&ecirc;n</h2>\r\n<p>Vận động thể chất thường xuy&ecirc;n l&agrave; một phần quan trọng của một lối sống l&agrave;nh mạnh. Bạn c&oacute; thể bắt đầu bằng những b&agrave;i tập nhẹ nh&agrave;ng v&agrave; tăng dần độ kh&oacute; v&agrave; thời gian tập luyện. Bạn c&oacute; thể thử c&aacute;c hoạt động như đi bộ, chạy bộ, bơi lội, v&agrave; yoga v&agrave; thực hiện &iacute;t nhất 30 ph&uacute;t tập thể dục mỗi ng&agrave;y. Nếu bạn đang c&oacute; c&aacute;c vấn đề về cơ xương khớp, h&atilde;y thăm kh&aacute;m b&aacute;c sĩ để được đưa ra lời khuy&ecirc;n về c&aacute;c b&agrave;i tập th&iacute;ch hợp tuy theo t&igrave;nh trạng sức khỏe của bạn.</p>\r\n<h2>2.Hạn chế h&uacute;t thuốc v&agrave; uống rượu</h2>\r\n<p>H&uacute;t thuốc v&agrave; uống rượu c&oacute; thể g&acirc;y ra nhiều t&aacute;c hại cho sức khỏe, bao gồm khả năng tăng nguy cơ mắc bệnh tim mạch. V&igrave; vậy, hạn chế hoặc ngừng h&uacute;t thuốc v&agrave; uống rượu l&agrave; một c&aacute;ch hiệu quả để ngăn ngừa hội chứng mạch v&agrave;nh cấp.</p>\r\n<h2>3.Kiểm so&aacute;t huyết &aacute;p v&agrave; đường huyết</h2>\r\n<p>Huyết &aacute;p v&agrave; đường huyết cao c&oacute; thể g&acirc;y ra nhiều t&aacute;c hại cho sức khỏe, bao gồm tăng nguy cơ mắc bệnh tim mạch. V&igrave; vậy, kiểm so&aacute;t v&agrave; duy tr&igrave; huyết &aacute;p v&agrave; đường huyết ở mức b&igrave;nh thường l&agrave; một c&aacute;ch hiệu quả để ngăn ngừa hội chứng mạch v&agrave;nh cấp. Theo khuyến c&aacute;o của Tổ chức Y tế Thế giới (WHO), mức huyết &aacute;p b&igrave;nh thường l&agrave; dưới 120/80 mmHg. Tuy nhi&ecirc;n, mức huyết &aacute;p tối đa khuyến c&aacute;o cho người lớn c&oacute; thể tăng l&ecirc;n đến 130/80 mmHg.</p>\r\n<p>Nếu bạn đ&atilde; được chẩn đo&aacute;n mắc huyết &aacute;p cao, b&aacute;c sĩ của bạn c&oacute; thể khuy&ecirc;n bạn n&ecirc;n duy tr&igrave; mức huyết &aacute;p ở mức n&agrave;o đ&oacute;ng vai tr&ograve; quan trọng trong việc điều trị tốt nhất cho t&igrave;nh trạng của bạn. Th&ocirc;ng thường, mức huyết &aacute;p mục ti&ecirc;u cho người mắc huyết &aacute;p cao l&agrave; dưới 130/80 mmHg.</p>\r\n<h2>4.Giảm c&acirc;n nếu cần thiết</h2>\r\n<p>B&eacute;o ph&igrave; v&agrave; thừa c&acirc;n c&oacute; thể tăng nguy cơ mắc bệnh tim mạch. V&igrave; vậy, nếu bạn c&oacute; thừa c&acirc;n hoặc b&eacute;o ph&igrave;, h&atilde;y giảm c&acirc;n theo một chế độ ăn uống l&agrave;nh mạnh v&agrave; thực hiện c&aacute;c b&agrave;i tập thể dục thường xuy&ecirc;n để giảm nguy cơ mắc bệnh tim mạch. Một trong những c&aacute;ch đ&aacute;nh gi&aacute; c&acirc;n nặng hiệu quả nhất cho người lớn l&agrave; chỉ số khối cơ thể (BMI). BMI được t&iacute;nh bằng c&aacute;ch chia c&acirc;n nặng (kg) cho b&igrave;nh phương chiều cao (m). Theo khuyến c&aacute;o của&nbsp;<a href=\"https://www.who.int/data/gho/data/themes/topics/topic-details/GHO/body-mass-index\">Tổ chức Y tế Thế giới (WHO),</a> người c&oacute; BMI từ 18,5 đến 24,9 được coi l&agrave; c&oacute; c&acirc;n nặng b&igrave;nh thường.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\"></p>\r\n<h2>5.Thay đổi chế độ ăn cho người bị mạch v&agrave;nh cấp</h2>\r\n<p>&nbsp;</p>\r\n<p>Ăn một&nbsp;<a href=\"https://www.vinmec.com/vie/bai-viet/cac-luu-y-ve-mot-che-do-uong-lanh-manh-vi\"><strong>chế độ ăn uống l&agrave;nh mạnh</strong></a>&nbsp;v&agrave; c&acirc;n bằng l&agrave; một c&aacute;ch hiệu quả để ngăn ngừa hội chứng mạch v&agrave;nh cấp. Một chế độ ăn uống l&agrave;nh mạnh bao gồm giảm lượng muối, ăn nhiều rau xanh, hoa quả, ngũ cốc nguy&ecirc;n hạt v&agrave; thực phẩm gi&agrave;u chất xơ. Hạn chế ăn thực phẩm c&oacute; chứa nhiều chất b&eacute;o, đường v&agrave; muối. N&ecirc;n ăn đủ c&aacute;c loại thực phẩm chứa vitamin v&agrave; kho&aacute;ng chất cần thiết cho cơ thể. Bạn n&ecirc;n hạn chế ăn thực phẩm chế biến sẵn, đồ ăn nhanh v&agrave; thực phẩm c&oacute; đường cao. Dưới đ&acirc;y l&agrave; những thực phẩm n&ecirc;n ăn để ph&ograve;ng ngừa hội chứng mạch v&agrave;nh cấp:</p>\r\n<ol>\r\n<li><strong>Thực phẩm gi&agrave;u chất xơ</strong>: Những thực phẩm chứa chất xơ như rau quả, ngũ cốc, hạt giống, đậu v&agrave; c&aacute;c loại rau củ gi&uacute;p giảm mức đường huyết v&agrave; cholesterol trong m&aacute;u.</li>\r\n<li><strong>Thực phẩm gi&agrave;u chất b&eacute;o omega-3</strong>: C&aacute;c loại c&aacute; như c&aacute; hồi, c&aacute; thu, c&aacute; mackerel v&agrave; c&aacute; tr&iacute;ch l&agrave; c&aacute;c nguồn gi&agrave;u omega-3, một loại chất b&eacute;o c&oacute; lợi cho tim mạch v&agrave; gi&uacute;p giảm nguy cơ đột quỵ v&agrave; bệnh tim mạch.</li>\r\n<li><strong>Thực phẩm gi&agrave;u chất chống oxy h&oacute;a</strong>: C&aacute;c loại tr&aacute;i c&acirc;y như d&acirc;u t&acirc;y, quả mọng, cam, bưởi v&agrave; c&aacute;c loại rau củ như c&agrave; chua, cải xoăn, s&uacute;p lơ đỏ, c&agrave; rốt l&agrave; những thực phẩm gi&agrave;u chất chống oxy h&oacute;a, gi&uacute;p bảo vệ tế b&agrave;o khỏi tổn thương v&agrave; giảm tổn thương tế b&agrave;o do oxy h&oacute;a.</li>\r\n<li><strong>Thực phẩm gi&agrave;u kali:</strong>&nbsp;C&aacute;c loại tr&aacute;i c&acirc;y như chuối, cam, dứa, xo&agrave;i, đu đủ v&agrave; c&aacute;c loại rau củ như cải xoăn, bắp cải, s&uacute;p lơ đỏ, c&agrave; rốt l&agrave; những thực phẩm gi&agrave;u kali gi&uacute;p giảm huyết &aacute;p v&agrave; ngăn ngừa bệnh tim mạch.</li>\r\n<li><strong>Thực phẩm gi&agrave;u magi&ecirc;:</strong>&nbsp;C&aacute;c loại hạt giống như hạt chia, hạt lanh, hạt dẻ, hạt hướng dương v&agrave; c&aacute;c loại rau củ như bắp cải, cải xoăn, s&uacute;p lơ đỏ, c&agrave; rốt l&agrave; những thực phẩm gi&agrave;u magi&ecirc; gi&uacute;p giảm nguy cơ bệnh tim mạch v&agrave; đột quỵ.</li>\r\n<li><strong>Thực phẩm gi&agrave;u chất xơ tan:</strong> C&aacute;c loại hạt giống như hạt lanh v&agrave; hạt chia, c&aacute;c loại rau củ như cải xoăn, bắp cải, s&uacute;p lơ đỏ, c&agrave; rốt v&agrave; c&aacute;c loại tr&aacute;i c&acirc;y như t&aacute;o, d&acirc;u t&acirc;y, nho đen gi&uacute;p giảm mức đường huyết v&agrave; cholesterol trong m&aacute;u.</li>\r\n</ol>','2024-08-15 14:51:39.983000','/uploads/images/small_20230523_073835_265560_Buoi_sang_la_thoi_g_max_1800x1800_jpg_1ea6008df9.jpg','Các yếu tố nguy cơ gây ra hội chứng mạch vành cấp bao gồm hút thuốc, uống rượu và bia quá mức, ăn uống không lành mạnh, thiếu hoạt động thể chất, stress và các bệnh lý khác như tiểu đường, tăng huyết áp, béo phì, và tăng cholesterol máu.',1,'Phương pháp phòng ngừa hội chứng mạch vành cấp','2024-08-15 15:12:28.478000','phuong-phap-phong-ngua-hoi-chung-mach-vanh-cap',1),(9,'<div class=\"tit_content_subcate\">Hoạt động 24/7</div>\r\n<div class=\"f16 mb3\">\r\n<p>Tất cả c&aacute;c ng&agrave;y trong tuần, kể cả Thứ 7, Chủ nhật v&agrave; ng&agrave;y lễ trong năm&nbsp;</p>\r\n</div>\r\n<div class=\"tit_content_subcate\">Uy t&iacute;n &amp; Phản ứng nhanh</div>\r\n<div class=\"f16 mb3\">\r\n<ul>\r\n<li>Đội ngũ b&aacute;c sĩ, nh&acirc;n vi&ecirc;n y tế được đ&agrave;o tạo b&agrave;o bản, chuy&ecirc;n s&acirc;u về nhiều lĩnh vực hồi sức cấp cứu với chứng chỉ quốc tế như ACLS (Hồi sinh tim phổi n&acirc;ng cao người lớn), PALS (Hồi sinh tim phổi n&acirc;ng cao trẻ nhi), FCCS, lu&ocirc;n cập nhật những ph&aacute;c đồ, kỹ thuật cấp cứu hiện đại (như E-PCR&hellip;) đ&aacute;p ứng trong mọi t&igrave;nh huống xảy ra. &nbsp;</li>\r\n<li>Hỗ trợ đắc lực cho khoa Cấp cứu l&agrave; đội ngũ thư k&yacute; chuy&ecirc;n m&ocirc;n phi&ecirc;n dịch vi&ecirc;n đa ng&ocirc;n ngữ Anh, Ph&aacute;p, H&agrave;n Quốc, Nhật Bản, Nga, Trung &hellip;</li>\r\n<li>Tất cả c&aacute;c xe cấp cứu chuy&ecirc;n dụng được trang bị hiện đại với hệ thống m&aacute;y thở chuy&ecirc;n nghiệp, m&aacute;y monitor theo d&otilde;i li&ecirc;n tục c&aacute;c chỉ số sinh tồn, m&aacute;y sốc điện tự động, băng ca chuy&ecirc;n dụng cấp cứu th&ocirc;ng thường v&agrave; đa chấn thương&hellip; Phản ứng xuất xe ngay khi c&oacute; y&ecirc;u cầu.&nbsp;</li>\r\n</ul>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\"></p>\r\n<div class=\"tit_content_subcate\">Quy tr&igrave;nh cấp cứu chuy&ecirc;n nghiệp</div>\r\n<div class=\"f16 mb3\">\r\n<ul>\r\n<li>Người bệnh được đ&aacute;nh gi&aacute; ch&iacute;nh x&aacute;c v&agrave; ph&acirc;n loại t&igrave;nh trạng bệnh theo thang điểm ph&acirc;n loại bệnh nh&acirc;n của &Uacute;c tại khoa Cấp cứu &ndash; chống độc. (ATS), &aacute;p dụng c&aacute;c biện ph&aacute;p cấp cứu th&iacute;ch hợp theo mức độ ưu ti&ecirc;n. &nbsp;</li>\r\n<li>Người bệnh được chăm s&oacute;c chuy&ecirc;n s&acirc;u, với sự phối hợp của nhiều chuy&ecirc;n khoa chuy&ecirc;n (chăm s&oacute;c theo nh&oacute;m chuy&ecirc;n khoa - Team Based Care) ngay từ l&uacute;c nhập viện, đảm bảo sự ch&iacute;nh x&aacute;c, nhanh ch&oacute;ng với mức độ tin cậy cao, để c&oacute; thể nhanh ch&oacute;ng qua khỏi giai đoạn nguy kịch v&agrave; ổn định.</li>\r\n<li>Khoa c&oacute; đầy đủ chức năng cấp cứu v&agrave; điều trị t&igrave;nh trạng cấp cứu, khẩn cấp cho bệnh nh&acirc;n thuộc c&aacute;c chuy&ecirc;n ng&agrave;nh kh&aacute;c nhau: Nội, Ngoại, Sản, Nhi.</li>\r\n<li>Khoa Hồi sức cấp cứu Vinmec cũng đảm nhiệm c&ocirc;ng t&aacute;c hồi sức sau phẫu thuật, c&aacute;c ca bệnh diễn biến nặng cần chăm s&oacute;c đặc biệt (sau đột quỵ, sau chấn thương nặng, người cao tuổi bệnh nặng&hellip;). &nbsp;</li>\r\n</ul>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\"></p>\r\n<div class=\"tit_content_subcate\">Thực hiện 4 m&ocirc; h&igrave;nh hồi sức cấp cứu</div>\r\n<div class=\"tit_content_subcate\">&nbsp;</div>\r\n<div class=\"tit_content_subcate\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\"></div>\r\n<div class=\"f16 mb3\">\r\n<p><strong>Đội phản ứng nhanh</strong></p>\r\n<p>Để ph&aacute;t hiện sớm c&aacute;c dấu hiệu thay đổi cấp t&iacute;nh của người bệnh, dự ph&ograve;ng từ xa c&aacute;c biến cố ngừng tuần ho&agrave;n (k&iacute;ch hoạt code blue) kh&ocirc;ng mong muốn, c&aacute;c khoa ph&ograve;ng c&oacute; thể y&ecirc;u cầu hỗ trợ của RRT tiếp cận đ&aacute;nh gi&aacute; v&agrave; đưa ra c&aacute;c can thiệp sớm nếu bệnh nh&acirc;n c&oacute; chỉ định can thiệp.</p>\r\n<p><strong>Xử tr&iacute; t&igrave;nh trạng nhiễm khuẩn huyết</strong></p>\r\n<p>Nhận diện được sớm c&aacute;c dấu hiệu tưởng chừng như mơ hồ khi b&ecirc;nh nh&acirc;n bị nhiễm khuẩn huyết v&agrave; sốc nhiễm khuẩn v&agrave; xử tr&iacute; kịp thời, tr&aacute;nh diễn biến nặng th&agrave;nh sốc nhiễm khuẩn, suy đa phủ tạng l&agrave; t&igrave;nh trạng nặng, điều trị thường kh&oacute; khăn, phức tạp v&agrave; tốn k&eacute;m tỉ lệ tử vong cao.</p>\r\n<div class=\"tit_content_subcate\">Đi buồng đa chuy&ecirc;n khoa</div>\r\n<div class=\"f16 mb3\">\r\n<p>H&agrave;ng ng&agrave;y đội Core (gồm b&aacute;c sĩ &amp; điều dưỡng hồi sức cấp cứu &ndash; phục hồi chức năng &ndash; dinh dưỡng &ndash; dược l&acirc;m s&agrave;ng) đi buồng c&aacute;c bệnh nh&acirc;n ICU. Th&ocirc;ng qua đ&oacute;, kế hoạch điều trị chăm s&oacute;c to&agrave;n diện trong mỗi ng&agrave;y được thảo luận v&agrave; thống nhất, nhằm được hiệu quả điều trị cao v&agrave; an to&agrave;n cho người bệnh.&nbsp;</p>\r\n<p><strong>Telemedicine trong hồi sức cấp cứu</strong></p>\r\n<p>Telemedicine cho ph&eacute;p đồng bộ h&oacute;a chất lượng điều trị trong to&agrave;n bộ c&aacute;c bệnh viện thuộc Hệ thống y tế Vinmec về lĩnh vực hồi sức cấp cứu.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2024-08-15 15:00:29.567000','/uploads/images/medium_cap_cu_dich_vu_001_a4320f30f2.jpg','Trong nhiều năm qua, Vinmec đã tiến hành cấp cứu và cứu sống những bệnh nhân nặng, phức tạp; thực hiện thành công nhiều sự việc cấp cứu lớn, cấp cứu hàng loạt. Hàng năm, các bệnh viện Vinmec tiếp nhận và cấp cứu thành công nhiều bệnh nhân hội chứng vành cấp, suy tim cấp theo đúng tiêu chuẩn của Hội tim mạch Hoa Kỳ (ACC/AHA), đột quỵ não theo đúng tiêu chuẩn ANGLES\r\n',1,'Cấp cứu','2024-08-15 15:00:29.567000','cap-cuu',1),(10,'<div class=\"container my-5\">\n    <!-- Introduction Section -->\n    <div class=\"row mb-5\">\n        <div class=\"col-lg-12 d-flex align-items-center\">\n            <img class=\"img-fluid mr-3\" src=\"https://hoanmy.com/wp-content/uploads/2023/05/la-co-1.png\" alt=\"Flag\">\n            <div>\n                <h2 class=\"display-4 text-primary\">Chào mừng bạn đến với <span class=\"text-info\">Hoàn Mỹ.</span><br>Chúng tôi là mạng lưới chăm sóc sức khỏe tư nhân hàng đầu tại Việt Nam.</h2>\n            </div>\n        </div>\n    </div>\n\n    <!-- Commitment Section -->\n    <div class=\"row mb-5\">\n        <div class=\"col-lg-12\">\n            <p>Hoàn Mỹ cam kết hướng tới sự xuất sắc trong hoạt động thăm khám lâm sàng, đào tạo và nghiên cứu nhằm cung cấp dịch vụ chăm sóc tốt nhất. Mạng lưới chăm sóc sức khỏe của chúng tôi bao gồm hơn 2.900 giường bệnh hoạt động trên khắp 13 bệnh viện và 4 phòng khám. Trải qua 27 năm hoạt động, Hoàn Mỹ đã tạo dựng được uy tín vững chắc trong việc cung cấp dịch vụ chăm sóc sức khỏe lấy bệnh nhân làm trung tâm, với chi phí hợp lý và chất lượng cao. Chúng tôi tự hào trong việc nỗ lực cải thiện chất lượng dịch vụ chăm sóc sức khỏe ở Việt Nam, góp phần vào sự phồn vinh và an sinh của đất nước. Hoàn Mỹ hiện có hơn 5.000 nhân viên và đã phục vụ hơn 5 triệu lượt bệnh nhân khám ngoại trú vào năm ngoái.</p>\n        </div>\n    </div>\n\n    <!-- Section with Information -->\n    <div class=\"row mb-5\">\n        <div class=\"col-lg-12\">\n            <section class=\"mb-5\">\n                <h2 class=\"display-4 text-center mb-4\">Hàng đầu tại Việt Nam</h2>\n                <p>Hoàn Mỹ cam kết hướng tới sự xuất sắc trong hoạt động thăm khám lâm sàng, đào tạo và nghiên cứu nhằm cung cấp dịch vụ chăm sóc tốt nhất. Mạng lưới chăm sóc sức khỏe của chúng tôi bao gồm hơn 2.900 giường bệnh hoạt động trên khắp 13 bệnh viện và 4 phòng khám. Trải qua 27 năm hoạt động, Hoàn Mỹ đã tạo dựng được uy tín vững chắc trong việc cung cấp dịch vụ chăm sóc sức khỏe lấy bệnh nhân làm trung tâm, với chi phí hợp lý và chất lượng cao. Chúng tôi tự hào trong việc nỗ lực cải thiện chất lượng dịch vụ chăm sóc sức khỏe ở Việt Nam, góp phần vào sự phồn vinh và an sinh của đất nước. Hoàn Mỹ hiện có hơn 5.000 nhân viên và đã phục vụ hơn 5 triệu lượt bệnh nhân khám ngoại trú vào năm ngoái.</p>\n            </section>\n\n            <!-- Information Section -->\n            <section class=\"bg-light py-5\">\n                <div class=\"container\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-6 mb-4\">\n                            <img class=\"img-fluid rounded\" src=\"https://hoanmy.com/wp-content/uploads/2023/05/image-1-1.png\" alt=\"Information\">\n                        </div>\n                        <div class=\"col-lg-6\">\n                            <h3 class=\"text-center mb-3\">Mục đích</h3>\n                            <p class=\"text-justify\">Vì mục tiêu nâng cao sức khỏe và hạnh phúc của mọi người dân Việt Nam.</p>\n                            <h3 class=\"text-center mb-3\">Tầm nhìn</h3>\n                            <p class=\"text-justify\">Trở thành đơn vị dẫn đầu toàn quốc về lĩnh vực chăm sóc sức khỏe và là thương hiệu chăm sóc sức khỏe đáng tin cậy nhất ở Việt Nam.</p>\n                            <h3 class=\"text-center mb-3\">Sứ mệnh</h3>\n                            <p class=\"text-justify\">Sứ mệnh của chúng tôi là nâng cao sức khỏe và đời sống của người dân Việt Nam, thông qua một hệ thống bao gồm các cơ sở chăm sóc sức khỏe tại các thành phố lớn với phương châm sáng tạo, tích hợp và lấy bệnh nhân làm trung tâm.</p>\n                        </div>\n                    </div>\n                </div>\n            </section>\n        </div>\n    </div>\n</div>\n','2024-08-15 15:19:06.794000','/uploads/images/Nurse-group-photo.png','Vì mục tiêu nâng cao sức khỏe và hạnh phúc của tất cả người dân Việt Nam. Tận tâm chăm sóc.\r\n',1,'Về Chúng tôi','2024-08-15 15:19:06.794000','ve-chung-toi',1);
